import{_ as p,o as a,c as e,R as r}from"./chunks/framework.-3ULgdun.js";const u=JSON.parse('{"title":"第八小组","description":"","frontmatter":{},"headers":[],"relativePath":"article/group-8/index.md","filePath":"article/group-8/index.md"}'),t={name:"article/group-8/index.md"},o=r('<h1 id="第八小组" tabindex="-1">第八小组 <a class="header-anchor" href="#第八小组" aria-label="Permalink to &quot;第八小组&quot;">​</a></h1><h2 id="十字路口" tabindex="-1">十字路口 <a class="header-anchor" href="#十字路口" aria-label="Permalink to &quot;十字路口&quot;">​</a></h2><h4 id="赵一凡" tabindex="-1"><em>赵一凡</em> <a class="header-anchor" href="#赵一凡" aria-label="Permalink to &quot;_赵一凡_&quot;">​</a></h4><p>当我站在人生的十字路口</p><p>不知往哪走</p><p>猛回头</p><p>背后满是荆棘丛</p><p>我曾走过</p><p>当我站在人生的十字路口</p><p>不知往哪走</p><p>尝试走</p><p>前方仍是荆棘丛</p><p>不敢走过</p><p>当我站在人生的十字路口</p><p>不知往哪走</p><p>深思索</p><p>无人替我向前走</p><p>必须去走</p><h2 id="铠甲勇士" tabindex="-1">铠甲勇士 <a class="header-anchor" href="#铠甲勇士" aria-label="Permalink to &quot;铠甲勇士&quot;">​</a></h2><h4 id="何昆容" tabindex="-1"><em>何昆容</em> <a class="header-anchor" href="#何昆容" aria-label="Permalink to &quot;_何昆容_&quot;">​</a></h4><p>面对黑暗势力</p><p>我并不惧怕</p><p>守护光明之道</p><p>我义不容辞</p><p>与怪物斗争</p><p>我奋不顾身</p><p>为光明献身</p><p>这是我心声</p><h2 id="叶" tabindex="-1">叶 <a class="header-anchor" href="#叶" aria-label="Permalink to &quot;叶&quot;">​</a></h2><h4 id="邹巧" tabindex="-1"><em>邹巧</em> <a class="header-anchor" href="#邹巧" aria-label="Permalink to &quot;_邹巧_&quot;">​</a></h4><p>叶在枝头欢快的摇摆</p><p>它的世界纷纷扰扰</p><p>有风的喧嚣，雨的淅沥</p><p>悲也罢，喜也罢</p><p>只要是人生中的一片叶</p><p>都值得初绽绿芽</p><p>于是乎</p><p>去便去了，留便留了</p><p>青也罢，黄也罢</p><p>这只不过是它的世界里</p><p>甘愿属于别人的时刻</p><p>只因它眷恋春的温柔</p><p>爱慕秋的洒脱</p><p>它似坐深闺的闺秀</p><p>展现才艺</p><p>留意自己相中的公子</p><p>它似坐戏院的戏子</p><p>卖弄歌舞</p><p>掠过一位位看客</p><p>两种人生，皆由它所扮演</p><p>它精灵古怪，它文静乖巧</p><p>它热烈张扬</p><p>见它以窥见多种人生</p><p>世界上没有两片一模一样的叶</p><p>亦没有两种一模一样的人生</p><p>不同的人生，有不同的惊喜</p><h2 id="咔嚓" tabindex="-1">咔嚓 <a class="header-anchor" href="#咔嚓" aria-label="Permalink to &quot;咔嚓&quot;">​</a></h2><h3 id="王思睿" tabindex="-1"><em>王思睿</em> <a class="header-anchor" href="#王思睿" aria-label="Permalink to &quot;_王思睿_&quot;">​</a></h3><p>我被一束白光刺醒</p><p>欲起身活动</p><p>却无法舒展身躯</p><p>想想旁伸的手僵在原地</p><p>我不满</p><p>费力睁开已合上千年的眼</p><p>试一探究竟</p><p>猛然发现已被人包围</p><p>又是一声咔嚓声</p><p>无尽的白光冲来</p><p>我不由得闭了眼</p><p>痛</p><p>禁不住一阵颤抖</p><p>我想逃</p><p>却有无形的屏障阻隔去路</p><p>我不甘</p><p>又另寻出路</p><p>转首</p><p>身畔赫然立着众多生人</p><p>我不解</p><p>犹记得</p><p>曾出浴于烈火</p><p>有丝绸作衣</p><p>后久居于暖室</p><p>受精心呵护</p><p>怎竟困于此地</p><p>相知自己身于何处</p><p>忽闻旁人叹</p><p>何为归期何为归期</p><p>忙问此言缘故</p><p>终知已身处他乡</p><p>咔嚓</p><p>我再次被恐惧笼罩</p><p>却无处躲藏</p><p>痛</p><p>似是肌肤将脱落</p><p>似是镣铐被牵功</p><p>又听得一句轻声慰语</p><p>习惯便罢</p><p>我回了神</p><p>只有一个念头愈发强烈</p><p>我要回家</p><p>要回家</p><h2 id="无题" tabindex="-1">无题 <a class="header-anchor" href="#无题" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="聂铭佑" tabindex="-1"><em>聂铭佑</em> <a class="header-anchor" href="#聂铭佑" aria-label="Permalink to &quot;_聂铭佑_&quot;">​</a></h4><p>在化学中</p><p>有一种物质性质稳定</p><p>它遇热不分解</p><p>遇冷则愈硬</p><p>它是一种良好的溶剂</p><p>它能溶酸</p><p>它能溶盐</p><p>它能溶碱</p><p>它是水</p><p>我们都能应当如同水一样</p><p>在生活中</p><p>我们遇到困难要坚强</p><p>我们要包容万事万物</p><p>我们要溶解生活中的酸甜苦辣咸</p><p>始终如一的面对生活</p>',118),i=[o];function h(l,n,d,c,s,_){return a(),e("div",null,i)}const b=p(t,[["render",h]]);export{u as __pageData,b as default};
